import React, { Component } from 'react'
import './Footer.css'

export default class Footer extends Component {
  render() {
    return (
      <>
      <div className='loc '>
        <div className='text-white '>
        <h2>LOCATION</h2>
        <p>2215 John Daniel Drive</p>
        <p>Clark, MO 65243</p>
        </div>
        </div>
        <div className='web'>
            AROUND THE WEB</div>
      </>
    )
  }
}
